        uint256 itemId
    ) public view returns (MarketItem memory item) {
        return idToMarketItem[itemId];
    }

    function getAuctionItemById(
        uint256 itemId
    ) public view returns (AuctionItem memory item) {
        return idToAuctionItem[itemId];
    }

